            <div class=\"img\">
                <img src=\"/templates/auth/img/bg.svg\">
            </div>
            <div class=\"login-content\">
                <form action=\"login.html.twig\">
                    <img src=\"../auth/img/avatar.svg\">
                    <h2 class=\"title\">Welcome</h2>
                    <div class=\"input-div one\">
                        <div class=\"i\">
                            <i class=\"fas fa-user\"></i>
                        </div>
                        <div class=\"div\">
                            <h5>Username</h5>
                            <input type=\"text\" class=\"input\">
                        </div>
                    </div>
                    <div class=\"input-div pass\">
                        <div class=\"i\">
                            <i class=\"fas fa-lock\"></i>
                        </div>
                        <div class=\"div\">
                            <h5>Password</h5>
                            <input type=\"password\" class=\"input\">
                        </div>
                    </div>
                    <a href=\"#\">Forgot Password?</a>
                    <input type=\"submit\" class=\"btn\" value=\"Login\">
                </form>
            </div>
        </div>
        <script type=\"text/javascript\" src=\"../auth/js/main.js\"></script>
    </div>

{%  endblock %}
